import classes from './Availabe.module.css';
const DUMMY_MEALS = [
	{
	  id: 'm1',
	  name: 'Sushi',
	  description: 'Finest fish and veggies',
	  price: 22.99,
	},
	{
	  id: 'm2',
	  name: 'Schnitzel',
	  description: 'A german specialty!',
	  price: 16.5,
	},
	{
	  id: 'm3',
	  name: 'Barbecue Burger',
	  description: 'American, raw, meaty',
	  price: 12.99,
	},
	{
	  id: 'm4',
	  name: 'Green Bowl',
	  description: 'Healthy...and green...',
	  price: 18.99,
	},
  ]; 
  const AvailableMeals = () =>{
	  const meals= DUMMY_MEALS.map((meal)=>{return(<div>
	  <li>{meal.name}</li>
	<li>{meal.description}</li>
	<li>{meal.price}</li>
	</div>
	  )
	  })
	  return(
		  <section className={classes.meals}>
		  <ul>
			  {meals}
		  </ul>
		  </section>


	  )
  }
  export default AvailableMeals;
